import React, { useState, useEffect } from 'react';
import axios from 'axios';
import GoogleMapComponent from './APIgoogle';

function Samsaung() {
  const [banners, setBanners] = useState([]);

  useEffect(() => {
    // Fetch banners using Axios
    axios.get('http://localhost:3004/banners')
      .then(response => setBanners(response.data))
      .catch(error => console.error('Error fetching banners:', error));
  }, []); // Empty dependency array to run the effect only once on mount

  return (
    <div style={{ display: 'flex', flexWrap: 'wrap' }}>
      {/* Render banners over the Google Map */}
      {banners.map(banner => (
        <div key={banner.id} style={{ margin: '10px', padding: '10px', border: '1px solid #ccc', borderRadius: '5px', display: 'flex', alignItems: 'center' }}>
          <img src={banner.img_brand_url} alt={banner.topic} style={{ maxWidth: '100px', maxHeight: '100px', marginRight: '10px' }} />
          <div style={{ flexGrow: '1' }}>
            <h3 style={{ fontSize: '18px', marginBottom: '5px' }}>{banner.topic}</h3>
            <p style={{ fontSize: '14px', color: '#555' }}>{banner.content}</p>
          </div>
        </div>
      ))}

      {/* Render the Google Map component */}
      <GoogleMapComponent />
    </div>
  );
}

export default Samsaung;
